using System.Xml.Serialization;
using Shouldly;
using UniversalDiveDataFormat.ExtensionMethods;
using UniversalDiveDataFormat.Models;

namespace UniversalDiveDataFormat.Tests.Models;

public class DiveComputerDumpTests
{
	private const string Xml = """
	                           <divecomputerdump>
	                             <dcdump></dcdump>
	                             <link ref="id89ea330f1ecc9bb0009ab7bc8b4b64c2"/>
	                             <datetime>2010-11-30T00:23:01</datetime>
	                           </divecomputerdump>
	                           """;
	
	[Fact]
	public void CanReadDiveComputerDump()
	{
		XmlSerializer serializer = new(typeof(DiveComputerDump));
		DiveComputerDump diveComputerDump = serializer.Deserialize<DiveComputerDump>(Xml);
		diveComputerDump.DcDump.ShouldEndWith("DfmlIK");
		diveComputerDump.DateTime.ShouldBe(new DateTime(2010, 11, 30, 0, 23, 01));
		diveComputerDump.Links.Count.ShouldBe(1);
	}
}